If you haven't packaged your project with Nix or if a check can't run in the Nix sandbox, you can run it as an effect . ci.nix let shell = import ./shell.nix {}; pkgs = shell.pkgs; effectsSrc = builtins.fetchTarball "https://github.com/hercules-ci/hercules-ci-effects/archive/COMMIT_HASH.tar.gz"; inherit (import effectsSrc { inherit pkgs; }) effects;
in
{ inherit shell; build = effects.mkEffect { src = ./.; effectScript = '' go build ''; inputs = [ shell.hook ]; };
} Replace COMMIT_HASH by the latest git sha from hercules-ci-effects , or, if you prefer, you can bring effects into scope using another pinning method .

